// src/main.ts
import * as fs6 from "fs";
import * as path4 from "path";
async function run() {
  try {
    const inputKey = getInput("gemini-api-key");
    const envKey = process.env.GEMINI_API_KEY;
    if (inputKey)
      info(" API Key encontrada va input 'gemini-api-key'");
    if (envKey)
      info(" API Key encontrada va variable de entorno 'GEMINI_API_KEY'");
    const apiKey = inputKey || envKey;
    if (!apiKey) {
      throw new Error("GEMINI_API_KEY no encontrada. Asegrate de pasarla en el bloque 'env:' o como input.");
    }
    info("\uD83D\uDE80 Starting Aura-Scope Report Generation...");
    const config2 = getConfig();
    const lang = config2.behavior.language;
    info(`Language set to: ${lang}`);
    const metadata = await getPRMetadata();
    info(`Processing PR #${metadata.number}: ${metadata.title}`);
    const aiInput = `
PR Title: ${metadata.title}
PR Description: ${metadata.description}

PR DIFF:
${metadata.diff}
`.trim();
    const reportsToGenerate = config2.behavior.reports;
    const dateStr = new Date().toISOString().split("T")[0];
    for (const type of reportsToGenerate) {
      info(`Generating ${type} report...`);
      const promptPath = path4.join(process.cwd(), "prompts", lang, `${type}_report.md`);
      if (!fs6.existsSync(promptPath)) {
        warning(`Prompt not found for ${type} in ${lang}. Skipping.`);
        continue;
      }
      const systemPrompt = fs6.readFileSync(promptPath, "utf8");
      const schemaPath = path4.join(process.cwd(), "prompts", "schemas", `${type}.json`);
      let schema = undefined;
      if (fs6.existsSync(schemaPath)) {
        schema = JSON.parse(fs6.readFileSync(schemaPath, "utf8"));
      }
      const aiResponse = await generateReport({
        prompt: systemPrompt,
        input: aiInput,
        apiKey,
        schema
      });
      const summary2 = aiResponse.executive_summary || aiResponse.operational_overview || aiResponse.architectural_overview || aiResponse.welcome_message || aiResponse.summary || "";
      const html = renderReport({
        reportType: type.charAt(0).toUpperCase() + type.slice(1),
        prNumber: metadata.number,
        date: dateStr,
        summary: summary2,
        data: aiResponse,
        branding: config2.branding,
        lang
      });
      saveReport({
        reportType: type,
        prNumber: metadata.number,
        html
      });
    }
    info(" All reports generated successfully!");
  } catch (error49) {
    setFailed(`Aura-Scope failed: ${error49.message}`);
  }
}
run();
